import React from "react";
import { NavLink } from "react-router-dom";
import "./SecondaryBar.css";

export default function SecondaryBar() {
  return (
    <div className="secondary-bar">
      <div className="secondary-wrap">
        <NavLink to="/current-affairs/daily">Daily</NavLink>
        <NavLink to="/current-affairs/monthly">Monthly</NavLink>
        <NavLink to="/current-affairs/upsc">UPSC</NavLink>
        <NavLink to="/current-affairs/ssc">SSC</NavLink>
        <NavLink to="/current-affairs/banking">Banking</NavLink>
        <NavLink to="/current-affairs/state-psc">State PSC</NavLink>
      </div>
    </div>
  );
}
